('http://www.frandroid.com/0-android/operateurs/217104_orange-achetait-bouygues-telecom', 'Et si Orange achetait Bouygues Telecom ?', '2014-05-15', 'Si l#8217;on parle cette semaine de Bouygues Telecom, c#8217;est bien peu pour l#8217;actualité de ses offres télécoms, mais bien pour l#8217;avenir économique de la société. Les syndicats évoquaient chez la firme, filiale du géant hexagonal du BTP, un risque de plan social massif pouvant aboutir au licenciement de près de 2000 employés. Tout cela devant#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.frandroid.com/0-android/operateurs/217109_free-mobile-maintient-croissance-atteint-86-millions-clients', 'Free Mobile maintient sa croissance et atteint 8,6 millions de clients', '2014-05-16', '8,635 millions d#8217;abonnés mobiles au premier trimestre 2014, c#8217;est le parc que revendique actuellement Free Mobile, contre légèrement plus de 8 millions au dernier trimestre 2013, soit un gain de 595 000 clients. C#8217;est à peine moins qu#8217;entre les troisième et quatrième trimestres 2013, où l#8217;opérateur avait acquis 605 000 nouveaux abonnés. Les trois mois#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.frandroid.com/0-android/operateurs/217147_numericable-en-negociations-exclusives-omea-telecom-rachat-virgin-mobile', 'Numericable entre en négociations exclusives pour le rachat de Virgin Mobile', '2014-05-16', 'Numericable, le câblo-opérateur que l’on connaît maintenant très bien pour avoir réussi à racheter SFR, a annoncé ce matin être entré en négociation exclusive pour racheter Virgin Mobile. Le plus grand opérateur virtuel français, qui compte aujourd’hui 1,7 millions de clients, devrait être racheté 325 millions d’euros. Voici ce que dit exactement le communiqué de#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.frandroid.com/0-android/social/217156_swarm-lapplication-foursquare-tournee-vers-partage-amis-disponible', 'Swarm : l’application de Foursquare tournée vers le partage entre amis est disponible', '2014-05-16', 'Êtes-vous prêts à passer à un (presque) nouveau réseau social ? Foursquare en semble convaincu, lui qui s#8217;est transformé, à force de check-in, de photos et d#8217;avis laissés sur des lieux d#8217;intérêt, en un concurrent de Yelp ou de Trip Advisor, voire de Google+. Le service, qui n#8217;abandonne pas pour autant la notion de check-in#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.frandroid.com/android/216937_android-pret-version-64-bit-du-tegra-k1-nvidia', 'Android prêt pour la version 64-bit du Tegra K1 de Nvidia', '2014-05-15', 'NVIDIA a frappé fort au CES 2014 en annonçant le successeur du Tegra 4, le Tegra K1. Deux versions avaient alors été dévoilées. La première, le Tegra K1 #171;#160;tout court#160;#187; possède quatre cœurs ARM Cortex-A15 32-bit qui peuvent être cadencés jusqu#8217;à 2,3 GHz ainsi qu#8217;un cinquième cœur, le #171;#160;compagnon#160;#187; qui est cadencé à une fréquence#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.frandroid.com/android/217112_google-play-accepte-paypal-methode-paiement-en-france-au-canada', 'Google Play accepte PayPal comme méthode de paiement en France, en Belgique et au Canada', '2014-05-15', 'Aux côtés de Google Wallet et du paiement opérateur (disponible chez Bouygues Telecom, Orange, SFR en France, ce qui permet d#8217;être directement facturé sur sa facture téléphonique), vous pourrez donc utiliser votre compte PayPal pour acheter du contenu sur le Google Play (jeux, vidéos, séries, musique, etc.). Google en a profité pour annoncer des chiffres#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.frandroid.com/applications/216910_monument-valley-disponible-android', 'Monument Valley est disponible sur Android', '2014-05-15', 'Monument Valley est un titre qui a beaucoup fait parler de lui lors de sa sortie sur iOS. Et pour cause, il s’agit tout d’abord d’un jeu de réflexion doté d’une direction artistique de toute beauté. Dans Monument Valley, on incarne une jeune princesse du nom de Ida qu’il faut guider d’un point A à#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
