('http://www.frandroid.com/marques/samsung/216976_samsung-promet-dedommagements-ses-ouvriers-malades', 'Samsung promet des dédommagements à ses ouvriers malades', '2014-05-15', 'Kwon Oh-hyun, l#8217;actuel PDG de la firme Samsung, a présenté au nom de l#8217;entreprise des excuses envers les employés de Samsung qui souffrent de problèmes de santé dû au travail effectué dans ses usines. Excuses formulées également aux familles de ceux qui y ont laissé la vie. On dénombre ainsi 26 travailleurs des usines de fabrications#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
