('http://www.frandroid.com/produits/lunettes-intelligentes/google-glass/217153_google-glass-ivy-ross-disney-mattel-sera-en-charge-du-design', 'Google Glass : Ivy Ross (Disney, Mattel) sera en charge du design', '2014-05-16', 'Ivy Ross fait partie de ces stars du design. Elle avait d#8217;ailleurs récemment participé à une conférence TEDx pour parler de design et de créativité. Elle s#8217;est fait connaître très tôt, après avoir travaillé sur des branches de lunettes en titane chez Bausch and Lomb dans les années 90. Dans une présentation courte sur le blog#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
