('http://www.frandroid.com/rumeurs/217124_lg-g3-coque-en-titanium', 'LG G3 : une coque en titane ?', '2014-05-15', 'Aluminium ou plastique ? A priori, @evleaks nous garantit que la coque sera composée de titanium, un métal de transition léger, résistant, d#8217;un aspect blanc métallique et qui a la particularité de très bien résister à la corrosion. Néanmoins, restons prudents : le Titane est un matériau très onéreux, il n#8217;est pas probable de le voir#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
