('http://www.frandroid.com/tablette/216879_xiaomi-devoile-tablette-mi-pad-tegra-k1-batterie-6700-mah', 'Xiaomi dévoile sa tablette Mi Pad de 7,9 pouces : Tegra K1 et batterie 6700 mAh', '2014-05-15', 'Alors qu#8217;on s#8217;attendait à ce que Xiaomi lève le voile sur le Mi3S lors de la conférence de presse de ce matin, c#8217;est finalement une télévision et une tablette qui ont été dévoilées : la fameuse Mi Pad. Le constructeur chinois n#8217;a pas lésiné sur les moyens et a intégré dans sa première tablette des composants#160;', 'file:////D://Users//Simon//Desktop//Projet Git//BDD//src//javafx//icons//rss_icon.png'),
('http://www.lalibre.be/actu/international/genocide-rwandais-les-commemorations-ont-commence-534279da3570d35ee3e8e835', 'Génocide rwandais : les commémorations ont commencé', '2014-04-07', 'La commémoration principale du 20ème anniversaire du génocide au Rwanda a débuté lundi en fin de matinée dans le stade Amahoro (&quot;paix&quot;) de Kigali. \nSuivez la cérémonie en direct.', 'http://r.llb.be/image/2b/534279893570d35ee3e8e82b.jpg'),
('http://www.lalibre.be/actu/international/rwanda-juppe-diable-dans-un-benitier-534192973570d35ee3e83d86', 'Rwanda : Juppé, diable dans un bénitier', '2014-04-06', 'Une interview de Paul Kagame sur le rôle de la France et la Belgique dans le génocide a jeté le feu aux poudres. Christine Taubira ne se rendra pas au Rwanda. Alain Juppé était ministre des Affaires étrangères français à l&apos;époque. \nUn commentaire de Marie-France Cros.', 'http://r.llb.be/image/04/5342546f3570d35ee3e8d304.jpg'),
('http://www.lalibre.be/culture/cinema/dix-raisons-de-se-souvenir-de-mickey-rooney-534280003570aae038afda0a', 'Dix raisons de se souvenir de Mickey Rooney', '2014-04-07', 'Quelque deux mois après Shirley Temple, Hollywood dit adieu à l&apos;autre enfant-star de son âge d&apos;or. \nRetour en dix points sur une carrière exceptionnelle avec Alain Lorfèvre.', 'http://r.llb.be/image/62/53427fb23570d35ee3e8e862.jpg'),
('http://www.lalibre.be/culture/livres/quand-gandhi-aimait-un-homme-533d642c3570aae038acd3a6', 'Quand Gandhi aimait un homme', '2014-04-03', 'Gilbert Sinoué raconte un épisode méconnu de la vie du Mahatma Gandhi.', 'http://r.llb.be/image/27/534279823570d35ee3e8e827.jpg'),
('http://www.lalibre.be/culture/medias-tele/pour-une-fois-que-ce-n-est-pas-le-front-national-qui-parle-ici-53425eb93570d35ee3e8d365', '&quot;Pour une fois que ce n&apos;est pas le Front National qui parle ici&quot;', '2014-04-07', 'Comme il l&apos;avait expliqué à La Libre, face à des journalistes, Jean-Luc Mélenchon se met en position de combat. Ce lundi matin, alors qu&apos;il avait revêtu son armure de circonstance, il a provoqué la colère du sanguin journaliste de BFM TV. \nDécouvrez la scène en vidéo.', 'http://r.llb.be/image/94/534267343570d35ee3e8d394.jpg'),
('http://www.lalibre.be/culture/politique/la-flandre-cogite-sur-l-avenir-des-musees-534241fa3570aae038afae34', 'La Flandre cogite sur l’avenir des musées', '2014-04-07', 'Quel avenir pour nos musées ? La N-VA, en tout cas, voudrait leur accorder une plus grande autonomie \n “sous le contrôle des communautés flamande et française”. Joke Schauvliege invite discrètement les seuls responsables néerlandophones.', 'http://r.llb.be/image/3c/534241b83570d35ee3e8bc3c.jpg'),
('http://www.lalibre.be/debats/opinions/branle-bas-de-combat-a-paris-53425f003570aae038afc49e', 'Branle-bas de combat à Paris', '2014-04-07', 'Les humoristes français reprochaient à Jean-Marc Ayrault de dormir – et d&apos;endormir. Que le reproche fût fondé ou non, l&apos;heure du réveil a en tout cas sonné à Matignon, avec des airs de sonnerie de clairon dans une caserne. \n Philippe Paquet débriefe le remaniement. ', 'http://r.llb.be/image/9b/53425ef23570aae038afc49b.jpg'),
('http://www.lalibre.be/lifestyle/psycho/mediter-au-bureau-pour-lutter-contre-le-stress-53426c0c3570d35ee3e8d3f7', 'Méditer au bureau, pour lutter contre le stress', '2014-04-07', 'Aux Etats-Unis, de plus en plus de sociétés peuvent profiter de cours de méditation pendant l&apos;heure de bureau. Ces derniers seraient plus épanouis. Reportage.', 'http://r.llb.be/image/24/53426c8a3570aae038afd824.jpg'),
('http://www.lalibre.be/light/insolite/une-sportive-heurtee-a-la-tete-par-un-drone-534278983570aae038afd9de', 'Une sportive heurtée à la tête par un drone !', '2014-04-07', 'La malheureuse triathlète australienne a été heurtée par un appareil tombé du ciel.', 'http://r.llb.be/image/21/534278b43570d35ee3e8e821.jpg'),
