('http://www.tomshardware.fr/articles/4g-orange-bouygues,1-47294.html#xtor=RSS-100', '4G : Orange rattrape Bouygues Telecom', '2014-04-03', 'L&apos;ANFR a publié son observatoire des antennes 4G pour le mois d&apos;avril, il est donc temps de faire notre habituel point. Le mois de mars a vu une hausse moyenne de 5,1 % du nombre de sites autorisés, ce qui est identique à la hausse pendant le mois de fé', 'http://media.bestofmicro.com/N/X/429837/gallery/Sites-4G-avril-2014_rc_120x90.png'),
('http://www.tomshardware.fr/articles/adata-sp920-ssd-marvell,1-47307.html#xtor=RSS-100', 'AData SP920 : un SSD Marvell sans over-provisioning ?', '2014-04-03', 'AData vient de présenter son Premier Pro SP920, un SSD au format 2,5 pouces destiné au marché grand-public friand de « hautes performances »...', 'http://media.bestofmicro.com/N/P/429829/gallery/productGallery3033-1-_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/amd-radeon,1-47279.html#xtor=RSS-100', 'Radeon HD R9 295 X2 : la carte avec deux GPU Hawaii se précise', '2014-04-01', 'Les rumeurs sur la future carte AMD Radeon HD R9 295 X2 se précisent. ', 'http://media.bestofmicro.com/B/M/429394/gallery/113916i2opjlcjck77662p_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/amd-radeon-r5-230-caicos,1-47330.html#xtor=RSS-100', 'AMD R5 230 : du Caicos silencieux en entrée de gamme', '2014-04-07', 'Si la majorité des processeurs AMD et Intel disposent désormais d&apos;une partie graphique intégrée, il existe encore un (petit) marché pour les cartes graphiques d’entrée de gamme...', 'http://media.bestofmicro.com/1/6/430314/gallery/AMD-Releases-Low-End-Radeon-R5-230-Graphics-Card-435739-2-1-_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/android-kitkat,1-47293.html#xtor=RSS-100', 'Android KitKat aura-t-il le temps de s&apos;imposer ?', '2014-04-02', 'Cinq mois à peu près jour pour jour, Google présentait Android 4.4 KitKat. La pénétration d&apos;une nouvelle version d&apos;Android est traditionnellement lente, surtout pendant les premiers mois, le temps que les constructeurs l&apos;adaptent sur leurs smartphones. ', 'http://media.bestofmicro.com/K/3/429699/gallery/Capture-2014-04-02-at-23.10.09_rc_120x90.png'),
('http://www.tomshardware.fr/articles/bouygues-numericable-sfr,1-47319.html#xtor=RSS-100', 'L&apos;acheteur de SFR pourrait être choisi aujourd&apos;hui', '2014-04-04', 'Après de multiples rebondissements, le rachat de SFR pourrait être enfin décidé aujourd&apos;hui. C&apos;est en effet aujourd&apos;hui que prend fin le délai de trois semaines pendant lequel Vivendi s&apos;était engagée à rester en négociations exclusives avec Numericable.', 'http://media.bestofmicro.com/T/K/430040/gallery/Bouygues-VS-drahi_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/chromebook,1-47295.html#xtor=RSS-100', '9 Chromebook sur 10 sont vendus aux USA', '2014-04-02', 'Chrome OS fera-t-il oublier Windows ? La réponse à cette question dépend du succès des Chromebook. Et pour le moment, elle semble plutôt négative. Selon les décomptes de ABIresearch, il ne s&apos;en est vendu que 2,1 millions au cours de l&apos;année 2013. C&apos;est ', 'http://media.bestofmicro.com/5/F/414915/gallery/HP-chromebook-11_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/cmstorm-triggerz-kingston-hyperx-beast,1-47306.html#xtor=RSS-100', 'Revue de tests : CM Storm Trigger Z, Kingston HyperX Beast', '2014-04-03', 'Notre confrère Cowcotland a récemment mis en ligne un test du Trigger Z de CM Storm, un clavier mécanique qui vient prendre la relève de l’excellent Trigger du constructeur...', 'http://media.bestofmicro.com/N/I/429822/gallery/trigger_004-1-_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/comparatif-cartes-graphiques,1-47281.html#xtor=RSS-100', 'Comparez les cartes graphiques avec Tom’s Hardware', '2014-04-01', 'Comme c’est le cas régulièrement, nous venons de mettre à jour nos comparatifs, ou « charts ». Aujourd’hui, nous mettons plus particulièrement en ligne un nouveau comparatif de cartes graphiques, avec un banc de tests mis à jour en version 2014...', 'http://media.bestofmicro.com/B/X/38013/gallery/chart_doom3_1024_trilinear_rc_120x90.png'),
('http://www.tomshardware.fr/articles/dell-durci,1-47296.html#xtor=RSS-100', 'Deux nouveaux portables « durcis » chez Dell [MAJ]', '2014-04-03', 'Dell vient d&apos;annoncer deux nouveaux modèles d&apos;ordinateurs portables « durcis », c&apos;est-à-dire résistants aux vicissitudes de la vie professionnelle. ', 'http://media.bestofmicro.com/G/K/429572/gallery/_10A1317_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/dual-boot-ios6-ios7,1-47280.html#xtor=RSS-100', 'Un hack pour triple-booter iOS 5, 6 et 7 sur l&apos;iPad 2', '2014-04-01', 'Lors de la sortie d’iOS 7, nous vous avions indiqué la marche à suivre pour revenir à iOS 6. Cette manipulation n’est malheureusement pas restée possible très longtemps et depuis, nombreux sans doute sont ceux qui aimeraient récupérer l’ancien design. Bon', 'http://media.bestofmicro.com/I/H/283193/gallery/iPad2-Cover_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/finfet-turbo-tsmc,1-47269.html#xtor=RSS-100', 'Des FinFET 16 nm &quot;Turbo&quot; dès la fin de l&apos;année chez TSMC', '2014-04-01', 'Vous ne la connaissez peut-être pas, mais la société TSMC est une des plus essentielles à l&apos;industrie informatique. Dans ses usines, elle grave les processeurs de Qualcomm, Nvidia, AMD et sans doute bientôt Apple. C&apos;est toute l&apos;informatique mondiale qui', 'http://media.bestofmicro.com/D/5/312809/gallery/TSMC_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/glass-trademark,1-47324.html#xtor=RSS-100', 'Google veut posséder le mot Glass', '2014-04-07', 'Google aurait déposé une demande afin de protéger le mot Glass pour pouvoir le traiter comme une marque, mais les autorités américaines ne semble pas vouloir accéder à la requête du moteur de recherche, selon le Wall Street Journal.', 'http://media.bestofmicro.com/K/F/380463/gallery/google-glass_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/hi-4g-orange,1-47328.html#xtor=RSS-100', 'Hi 4G : le smartphone 4G à 120 € chez Orange', '2014-04-07', 'Orange, de temps en temps, propose des smartphones sous sa marque (comme un des premiers smartphones équipés d&apos;un Atom il y a quelques années). ', 'http://media.bestofmicro.com/1/4/430312/gallery/Unknown_rc_120x90.jpeg'),
('http://www.tomshardware.fr/articles/ibm-globalfoundries-rachat,1-47322.html#xtor=RSS-100', 'Globalfoundries rachèterait les semiconducteurs d&apos;IBM', '2014-04-05', 'Globalfoundries est aujourd’hui la société qui a le plus de chance de reprendre l’activité semiconducteurs d’IBM, selon les révélations du Wall Street Journal. Intel serait toujours dans la course et TSMC aurait finalement décidé d’abandonner.\n', 'http://media.bestofmicro.com/M/J/422011/gallery/p64347569-3_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/ibm-serveurs-lenovo-usa,1-47325.html#xtor=RSS-100', 'Les États-Unis s&apos;opposeraient au rachat des serveurs IBM par Lenovo', '2014-04-07', 'Le Pentagon et le FBI ont exprimé leurs craintes concernant le rachat de la division serveurs x86 d’IBM par Lenovo. Ces deux agences se fournissaient chez Big Blue et elles ont peur que le rachat n’ouvre la porte à des opérations de piratage chinoises.\n', 'http://media.bestofmicro.com/4/O/370824/gallery/Pentagon400-300_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/intel-braswell-cherry-trail-atom,1-47317.html#xtor=RSS-100', 'Intel Braswell : un Atom en 14 nm pour l’entrée de gamme', '2014-04-04', 'Intel a profité de l’IDF de Shenzen pour annoncer Braswell, le SoC qui devrait venir succéder à L’actuel Atom Bay Trail au catalogue du constructeur. Gravée en 14 nm, cette puce 64-bit est destinée au marché des ordinateurs et portables d’entrée de gamme.', 'http://media.bestofmicro.com/T/W/430052/gallery/intel-braswell-1-_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/intel-core-i5-4460t-haswell,1-47286.html#xtor=RSS-100', 'Intel Core i5-4460T : Haswell, quad-core et seulement 35W', '2014-04-02', 'C’est sans grande annonce et même plutôt en catimini qu’Intel vient de lancer le Core i5-4460T, un processeur Haswell quad-core « basse consommation » affichant un TDP de seulement 35 watts...', 'http://media.bestofmicro.com/S/K/207092/gallery/intel-logo_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/ipad-office,1-47323.html#xtor=RSS-100', 'Office pour iPad : déjà 12 millions de téléchargements', '2014-04-05', 'Le compte Twitter d’Office, la suite bureautique de Microsoft, a fait savoir qu’Office pour iPad avait dépassé les 12 millions de téléchargements sur l’App Store. Pour rappel, Office a été lancé le 27 mars dernier sur la plateforme de vente d’Apple.\n', 'http://media.bestofmicro.com/N/B/280775/gallery/apple-ipad-2_rc_120x90.jpg');
INSERT INTO `publication` (`url`, `title`, `releaseDate`, `description`, `image`) VALUES
('http://www.tomshardware.fr/articles/iphone6,1-47272.html#xtor=RSS-100', 'iPhone 6 : le plein de rumeurs, avec de vraies photos floues volées dedans', '2014-04-01', 'Sans doute pour célébrer l&apos;arrivée du printemps, les rumeurs et fuites supposées sur l&apos;iPhone 6 se multiplient ces derniers jours. Et elles n&apos;émanent plus seulement de quelques blogs ou forums chinois, les très sérieux Nikkei ou Reuters les appuient. Alor', 'http://media.bestofmicro.com/D/6/429450/gallery/iPhone-6-CW.jpg-Image-JPEG-1280-1740-pixels-_rc_120x90.png'),
('http://www.tomshardware.fr/articles/lacie-thunderbolt,1-47263.html#xtor=RSS-100', 'LaCie : jusqu&apos;à 48 To en Thunderbolt 2', '2014-04-07', 'LaCie vient d&apos;annoncer, lors du NAB, ses nouvelles solutions Thunderbolt 2, une interface très rapide utilisée essentiellement sur les ordinateurs Apple. ', 'http://media.bestofmicro.com/O/R/429867/gallery/2big_TBT2_3Qtr-open_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/lumia-930-windows-phone-8.1,1-47301.html#xtor=RSS-100', 'Nokia annonce le Lumia 930 pour aller avec Windows Phone 8.1', '2014-04-03', 'Nokia a dévoilé un nouveau téléphone, le Lumia 930, qui sert à promouvoir Windows Phone 8.1. Il a un design un peu plus rectangulaire que les anciens modèles...', 'http://media.bestofmicro.com/G/V/429583/gallery/BkOKWJ8CQAANIlR_rc_120x90.png'),
('http://www.tomshardware.fr/articles/msi-b85,1-47292.html#xtor=RSS-100', 'MSI : B85 et Mini ITX pour les joueurs', '2014-04-02', 'MSI vient d&apos;annoncer deux nouvelles cartes mères pour les joueurs, articulées autour du chipset B85. ', 'http://media.bestofmicro.com/G/D/429565/gallery/five_pictures3_3080_20140205145656_rc_120x90.png'),
('http://www.tomshardware.fr/articles/newton-mips-oit,1-47285.html#xtor=RSS-100', 'Newton, le processeur MIPS pour les objets connectés', '2014-04-02', 'Imagination, la société à l&apos;origine des PowerVR et qui avait racheté MIPS il y a quelques mois, vient d&apos;annoncer Newton, une plateforme pour les objets connectés. ', 'http://media.bestofmicro.com/F/H/429533/gallery/Ingenic-Newton-MIPS-based-Ingenic-JZ4775-CPU_rc_120x90.png'),
('http://www.tomshardware.fr/articles/nom-origine-high-tech-technologie,1-47291.html#xtor=RSS-100', 'Tom’s Guide : d’où viennent les grands noms de la high-tech ?', '2014-04-02', 'Nos collègues et voisins de chez Tom’s Guide viennent de mettre en ligne un dossier consacré aux grands noms de la high-tech, et plus particulièrement à leurs étonnantes origines...', 'http://media.bestofmicro.com/C/C/429420/gallery/all9_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/open-source-winjs,1-47299.html#xtor=RSS-100', 'WinJS devient open source', '2014-04-03', 'Microsoft vient de publier le code source de WinJS sous licence Apache 2.0. La mesure fut une agréable surprise qui marque non seulement un changement de politique pour la société...', 'http://media.bestofmicro.com/E/5/294701/gallery/windows8_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/pholed-galaxy-s5,1-47312.html#xtor=RSS-100', 'L&apos;écran du Galaxy S5 utiliserait des PHOLED', '2014-04-04', 'L’écran du Galaxy S5 est le meilleur écran de smartphone jamais testé par Display Mate. Il est nettement mieux que celui du Galaxy S4 et OLED-Info affirme que le secret de Samsung est dans l’utilisation de PHOLED.\n', 'http://media.bestofmicro.com/4/F/423951/gallery/gsmarena_001_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/raijintek-pallas-roccat-ryos-strike-x,1-47334.html#xtor=RSS-100', 'Revue de tests : Raijintek Pallas, ROCCAT Ryos MK Pro, Aerocool Strike-X Extrem BE', '2014-04-07', 'Notre confrère Cowcotland a récemment mis en ligne un test du Pallas du constructeur Raijintek, un système de refroidissement « top-flow » haut de gamme...', 'http://media.bestofmicro.com/1/5/430313/gallery/Raijintek_Pallas_011-1-_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/roaming-europe,1-47310.html#xtor=RSS-100', 'L&apos;Europe met fin au roaming', '2014-04-04', 'Le Parlement européen vient de voter la fin du roaming par les opérateurs de l’Union d’ici 2015. Le texte sera maintenant soumis au Conseil européen qui devra donner son accord, selon Le Monde.\n', 'http://media.bestofmicro.com/R/A/398854/gallery/Roaming_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/samsung-galaxy-processeur,1-47284.html#xtor=RSS-100', 'Le Galaxy S 4, Android 4.4 et la diminution de la fréquence du CPU', '2014-04-02', 'Avec Android 4.4, on le sait, Samsung a arrêté de tricher dans les benchmarks avec ses smartphones. Ou en tout cas, la triche est moins voyante...', 'http://media.bestofmicro.com/2/0/429048/gallery/image009_rc_120x90.png'),
('http://www.tomshardware.fr/articles/sfr-altice-numericable,1-47326.html#xtor=RSS-100', 'SFR : Vivendi choisit Numericable (Altice)', '2014-04-05', 'C&apos;est finalement aujourd&apos;hui, un samedi, que Videndi a annoncé son choix pour le rachat de SFR : ce sera Altice, maison mère de Numericable. ', 'http://media.bestofmicro.com/4/O/160872/gallery/logo_sfr_rc_120x90.png'),
('http://www.tomshardware.fr/articles/silencio-652s-almaz-sfx-st30sf,1-47314.html#xtor=RSS-100', 'Revue de tests : Silencio 652S, Attitude One Almaz, Silverstone SFX SST ST30SF', '2014-04-04', 'Notre confrère Cowcotland a récemment publié un test du Silencio 652S du constructeur Cooler Master, un boîtier bien entendu dédié au « silence »...', 'http://media.bestofmicro.com/3/7/426499/gallery/41a_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/sofia-atom,1-47303.html#xtor=RSS-100', 'SoFIA : l&apos;Atom 3G se montre', '2014-04-03', 'Intel, à l&apos;IDF, a montré le SoC SoFIA en action.', 'http://media.bestofmicro.com/S/K/207092/gallery/intel-logo_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/synthese-graphene-samsung,1-47318.html#xtor=RSS-100', 'Samsung trouve un moyen de fabriquer du graphène à grande échelle', '2014-04-04', 'Le graphène est un matériau miracle pour l&apos;électronique. Il est 100 fois meilleur conducteur que le silicium et a permis la réalisation de transistors ultrarapides. Il possède en plus des dizaines d&apos;autres applications potentielles grâce à ses excellentes', 'http://media.bestofmicro.com/U/4/430060/gallery/https-www.sciencemag.org-content-suppl-2014-04-02-science.1252268.DC1-Lee.SM.pdf_rc_120x90.png'),
('http://www.tomshardware.fr/articles/tegra-k1-directx-12,1-47311.html#xtor=RSS-100', 'Le Tegra K1 de NVIDIA gèrera DirectX 12', '2014-04-04', 'Le SoC Tegra K1 sera compatible DirectX 12, selon Bright Side of News. Nous savons déjà que la puce est compatible OpenGL 4.4 et OpenGL ES 3.0 (cf. « Tegra K1 : Nvidia nous en dit plus sur l’architecture »). La puce prendra aussi en charge CUDA.\n', 'http://media.bestofmicro.com/P/3/416919/gallery/displaymedia.ashx_rc_120x90.jpeg'),
('http://www.tomshardware.fr/articles/thermolab-itx30-asus-hero,1-47288.html#xtor=RSS-100', 'Revue de tests : ThermoLab ITX30, Asus Hero', '2014-04-02', 'Notre confrère Cowcotland a récemment mis en ligne un test du Thermolab ITX30, un système de refroidissement pour CPU, destiné aux machines compactes...', 'http://media.bestofmicro.com/F/7/429523/gallery/ThermoLab_ITX30_004-1-_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/usb3-reversible,1-47297.html#xtor=RSS-100', 'USB 3.1 réversible : vue d&apos;artiste et informations', '2014-04-02', 'L&apos;USB 3.1 et son connecteur réversible se précise, et The Verge nous livre une vue d&apos;artiste des câbles et des prises, imaginée à partir des informations glanées chez Foxconn. ', 'http://media.bestofmicro.com/F/J/429535/gallery/Capture-d-e-cran-2014-04-02-a-16.06.08_rc_120x90.png'),
('http://www.tomshardware.fr/articles/webos-hp-proces,1-47282.html#xtor=RSS-100', 'HP paye 57 millions $ parce qu&apos;il a abandonné WebOS', '2014-04-02', 'HP vient de passer un accord à l’amiable avec ses actionnaires dans le but de résoudre le procès intenté après l’abandon de WebOS et du TouchPad par Léo Apothéker (cf. « HP met fin au TouchPad et veut vendre sa division PC »).', 'http://media.bestofmicro.com/M/E/280742/gallery/webos-PC_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/wifi-11ac-qualcomm,1-47309.html#xtor=RSS-100', 'Du Wi-Fi 11ac à 1,7 gigabit/s chez Qualcomm', '2014-04-07', 'Depuis quelques années, la nome 802.11ac tente de faire son trou, entre l&apos;antique mais très utilisé 802.11g (54 mégabits/s) et le 802.11n. ', 'http://media.bestofmicro.com/Q/L/4845/gallery/qualcomm_rc_120x90.png'),
('http://www.tomshardware.fr/articles/wifi-5ghz,1-47304.html#xtor=RSS-100', 'De nouvelles fréquences 5 GHz pour le Wi-Fi... aux États-Unis', '2014-04-03', 'La FCC, aux États-Unis, commence à s&apos;inquiéter de la prolifération des réseaux Wi-Fi dans la bande des 5 GHz et vient d&apos;ouvrir au public quelques fréquences de plus. ', 'http://media.bestofmicro.com/U/1/271945/gallery/fcc-logo-cover_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-8.1-menu-demarrer,1-47302.html#xtor=RSS-100', 'Microsoft cède et promet un menu Démarrer pour Windows 8.1 update 2', '2014-04-03', 'Parmi les nombreuses nouveautés de la Build, Microsoft a montré ce que le monde (presque) entier attend depuis deux ans : un menu démarrer pour Windows 8.1. Le bouton démarrer a déjà fait son retour mais il n&apos;appelle pour le moment que l&apos;écran d&apos;accueil à', 'http://media.bestofmicro.com/N/F/429819/gallery/vlcsnap-2014-04-03-10h32m01s82_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-8.1-update,1-47321.html#xtor=RSS-100', 'Windows 8.1 Update : retour à l&apos;ergonomie de Windows XP ?', '2014-04-07', 'Windows 8.1 &quot;Update 1&quot; débarque demain. Cette nouvelle mise à jour améliore encore l&apos;ergonomie du système sur les PC classiques pilotés à la souris. Découvrez en images les dernières améliorations...Windows 8.1 Update : retour à l&apos;ergonomie de Windows X', 'http://media.bestofmicro.com/S/J/430003/gallery/win81u1-01_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-8.1-update,5-233.html#xtor=RSS-100', 'Windows 8.1 Update : retour à l&apos;ergonomie de Windows XP ?', '2014-04-07', 'Windows 8.1 &quot;Update 1&quot; débarque le 8 Avril. Cette nouvelle mise à jour améliore encore l&apos;ergonomie du système sur les PC classiques pilotés à la souris. Découvrez en images les dernières améliorations...', 'http://media.bestofmicro.com/S/J/430003/gallery/win81u1-01_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-gratuit,1-47305.html#xtor=RSS-100', 'Windows devient gratuit sur les écrans de 9 pouces et moins', '2014-04-03', 'Les rumeurs d&apos;une licence gratuite de Windows se sont faites insistantes ces derniers mois, à raison. Dans le flot d&apos;annonces de la Keynote d&apos;hier soir, Terry Myerson a glissé le fait que Windows serait dorénavant gratuit pour tous les smartphones et ta', 'http://media.bestofmicro.com/N/D/429817/gallery/vlcsnap-2014-04-03-10h34m13s15_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-phone-8.1-windows-update1,1-47298.html#xtor=RSS-100', 'Microsoft annonce Windows Phone 8.1 et Windows 8.1 Update 1', '2014-04-02', 'Microsoft vient d’ouvrir sa Build Developper Conference et en profite pour annoncer deux « grosses » nouveautés très attendues : Windows Phone 8.1 et Windows 8.1 Update 1.', 'http://media.bestofmicro.com/G/R/429579/gallery/Image6_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/windows-xbox-one,1-47300.html#xtor=RSS-100', 'La Xbox One fera tourner des applications Windows', '2014-04-03', 'Microsoft a annoncé la création d’applications universelles qui tourneront sur PC, téléphones, tablettes et même la Xbox One.', 'http://media.bestofmicro.com/J/P/385621/gallery/xbox-one-console-2-625x1000_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/windows-xp,1-47290.html#xtor=RSS-100', 'Windows XP : retour sur plus de 12 ans de règne', '2014-04-03', 'Cette fois, nous y sommes ! Mardi prochain, Microsoft arrêtera définitivement le support de son système d&apos;exploitation phare, Windows XP. Ultime retour sur la genèse, les succès et les échecs du chef d’œuvre de Microsoft.Windows XP : retour sur plus de ', 'http://media.bestofmicro.com/I/1/427033/gallery/windows-xp-boot_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-xp,5-227.html#xtor=RSS-100', 'Windows XP : retour sur plus de 12 ans de règne', '2014-04-03', 'Cette fois, nous y sommes ! Mardi prochain, Microsoft arrêtera définitivement le support de son système d&apos;exploitation phare, Windows XP. Ultime retour sur la genèse, les succès et les échecs du chef d’œuvre de Microsoft.', 'http://media.bestofmicro.com/I/1/427033/gallery/windows-xp-boot_rc_120x90.png'),
('http://www.tomshardware.fr/articles/windows-xp-eol,1-47313.html#xtor=RSS-100', 'Tom’s Guide : Arrêt de Windows XP, que faire ?', '2014-04-04', 'Alors que Windows XP est sur le point de définitivement tirer sa révérence, nos collègues et voisins de chez Tom’s Guide viennent de mettre en ligne un dossier consacré à l’après-Windows XP...', 'http://media.bestofmicro.com/C/T/421661/gallery/WindowsXP-Cover_rc_120x90.jpg'),
('http://www.tomshardware.fr/articles/xbox-one-ps4-ventes,1-47283.html#xtor=RSS-100', 'La PS4 se vend deux fois mieux que la Xbox One', '2014-04-02', 'Les derniers rapports de VGChartz affirment que durant la semaine qui s’est terminée le 22 mars 2013, il s’est venu presque deux fois plus de PS4 que de Xbox One...', 'http://media.bestofmicro.com/K/C/385644/gallery/59d51511-a3a1-42df-8f82-912b0a1e05cb.png-n-XBR_Hero2_rc_120x90.png'),
